export const modalStyles = {
  content: {
    borderRadius: "4px",
    minWidth: "30em", // 30 * font size
    maxHeight: "800px",
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
  },
  overlay: {
    background: "#00000099",
  },
}
